function strip(html)
{
    return html.replace(/<[^>]+>/ig,"").replace(/\s+/g, ' ').trim().substring(0, 160)
}
async function getData(slug) {
    const res = await fetch(`https://api-montlucon.netcomdev2.com/wp-json/montlucon/v1/bien-louer/${slug}`)

    if (!res.ok) {
        return false;
    }

    return res.json()
}

export async function generateMetadata({ params, searchParams }, parent) {
    const lastSlug = params.slug;
    const data = (await getData(lastSlug))[0];
    if (!data) return {
        title: "Page non trouvée",
        description: 'Location de logement (appartement et maison) pas cher à Montluçon y compris pour les étudiants.'
    };
    let metas = {
        title: data.titre,
        openGraph: {
            title: data.titre,
            images: [
                {
                    url: data.image, // Must be an absolute URL
                    width: 800,
                    height: 600,
                },
            ],
            locale: 'fr_FR',
            type: 'website',
        },
        twitter: {
            card: 'summary_large_image',
            title: data.titre,
            images: [data.image], // Must be an absolute URL
        },
    }
    if (data.chapo || data.description) {
        metas.description = data.chapo ?? strip(data.description)
        metas.openGraph.description = data.chapo ?? strip(data.description)
        metas.twitter.description = data.chapo ?? strip(data.description)
    }
    return metas
}

